function ({obj, propName, value1, value2, value3}, {output1, output2, output3, default}) {
  const propValue = obj[propName];
  if (propValue === value1) {
    output1.next(obj);
  } else if (propValue === value2) {
    output2.next(obj);
  } else if (propValue === value3) {
    output3.next(obj);
  } else {
    default.next(obj);
  }
}
